const Persons = ({ ps, filterQuery }) =>
  ps
    .filter((person) => person.name.toLowerCase().includes(filterQuery))
    .map((persons) => (
      <div key={persons.name}>
        {persons.name}
        {persons.number}
      </div>
    ));
export default Persons;
